INSERT INTO "public"."comparison_frameworks" ("id", "products_compared", "comparison_context", "key_differentiators", "decision_criteria", "embedding", "created_at", "updated_at") VALUES
	('535d2263-0f6d-4463-98f0-370242e4a0d9', '{a84ed3b1-af81-4bbe-9f76-04e3aa95a078,eae98cf2-100b-45c1-9fa8-73b057b7d288}', 'Aeron vs Cosm - Which premium chair is right for you?', '{"aesthetic": {"cosm": "Sculptural, modern, seamless - looks like a single piece of material. Available in striking colors like Canyon, Glacier, Studio White. Makes a statement about design forward thinking.", "aeron": "Industrial, technical, iconic - recognizable from tech offices and films. Available in all-black or mixed finishes. Makes a statement about performance and seriousness.", "recommendation_trigger": "Consider the environment: Aeron for traditional tech/corporate, Cosm for design studios, creative agencies, or modern offices"}, "price_and_value": {"cosm": "$1,195+ (Mid Back with arms). Premium for the automatic adjustment technology. Newer to market (2019) but backed by Herman Miller engineering.", "aeron": "$1,695+ (Size B, fully loaded). Premium for the granular control and proven 30-year track record. Holds resale value exceptionally well.", "recommendation_trigger": "Cosm offers 70% of Aeron benefits at 70% of the cost. Aeron is the investment if you want absolute best and maximum adjustability."}, "best_for_scenarios": {"cosm": ["Shared workspaces and hot-desking environments", "Users who find adjustment controls overwhelming", "Offices prioritizing clean, modern aesthetics", "Teams with diverse body types sharing chairs", "Users who value simplicity and want to ''just sit down''"], "aeron": ["Individuals with specific ergonomic needs or medical conditions", "Users who sit 8+ hours daily in the same chair", "Those who want maximum adjustability and control", "Home offices where one person uses the chair", "Users who have tried the Aeron before and know they love it"]}, "adjustment_philosophy": {"cosm": "Automatic intelligence - Zero manual adjustments needed. The chair dynamically responds to your body and movements in real-time. Best for hot-desking, multiple users, or those who prefer simplicity.", "aeron": "Manual precision - 12+ adjustment points for perfect customization. You dial in your exact preferences once, and the chair remembers. Best for users who know what they want and have an assigned desk.", "recommendation_trigger": "Ask: ''Is this your personal chair, or will others use it?''"}, "back_support_mechanism": {"cosm": "Intercept Suspension with Auto Harmonic Tilt - provides continuous support that moves with you. Less structure, more natural movement. The suspension is one piece from seat to back.", "aeron": "PostureFit SL with sacral and lumbar support - targets specific vertebrae. The 8Z Pellicle has eight zones of varying tension. More structured support that guides your posture.", "recommendation_trigger": "Ask: ''Do you prefer a chair that guides your posture, or one that moves naturally with you?''"}}', '{"Single user vs multiple users","Preference for manual control vs automatic adjustment","Aesthetic fit with environment","Budget considerations","Specific ergonomic needs or conditions","Importance placed on iconic design vs modern sculptural design"}', '[0.013772071,0.03743473,0.042178765,0.016834129,0.048159122,-0.036600932,-0.009603073,0.05063177,0.03401328,0.020284334,-0.03133937,-0.023447024,0.0010745953,-0.018401098,0.0013450411,0.046175253,-0.017509794,-0.08372499,-0.032000657,0.0062858434,0.0013944581,0.04930919,-0.014591495,0.0076767076,0.013362359,-0.0059623867,-0.05586458,-0.02859358,0.0015786488,-0.011249108,0.0159572,-0.029326748,0.014699314,0.0029057201,-0.05436949,0.0075041973,-0.004934513,0.03251819,0.034962084,-0.002621797,-0.011529437,0.057474677,0.026537832,-0.020198079,-0.025531523,-0.047411576,-0.012600439,0.026394073,-0.017222276,0.029211741,-0.0428113,-0.0010943621,0.021592537,-0.0018886282,0.022296954,0.02817668,-0.0435876,-0.011730699,0.0019802742,0.01911989,0.022613224,-0.026279066,0.0066955555,0.0021473935,-0.0469803,-0.011586941,0.007231056,0.04209251,-0.007137613,-0.022354458,0.054283