	('873875d1-7e6b-4952-8e0c-643096e2e35d', '{a84ed3b1-af81-4bbe-9f76-04e3aa95a078,543f17bc-f34f-47b2-af45-1d6f930da323}', 'Aeron vs Lino - Premium flagship vs accessible ergonomics', '{"price_positioning": {"lino": "$799+ - Herman Miller''s newest chair designed to make their ergonomic expertise more accessible. Modern engineering that delivers exceptional value without compromising core ergonomic principles.", "aeron": "$1,695+ - Herman Miller''s flagship product for 30 years. The most researched and refined office chair ever made. You''re paying for decades of ergonomic research and proven results.", "recommendation_trigger": "If budget is the main concern, Lino delivers 80% of Aeron benefits at 47% of the price. If you want the absolute best regardless of cost, Aeron is still the gold standard."}, "adjustment_options": {"lino": "6-8 adjustment points - seat height, arm height, recline tension, optional seat depth. Streamlined adjustments that cover the essentials without overwhelming complexity.", "aeron": "12+ adjustment points - seat height, depth, arm height, width, pivot, recline tension, recline lock, forward tilt, PostureFit SL lumbar depth and height. Can be tuned to micrometer precision.", "recommendation_trigger": "Ask: ''Have you used high-end ergonomic chairs before?'' If yes and they appreciated the adjustments, go Aeron. If they found it overwhelming or never adjusted their old chair, Lino is perfect."}, "aesthetic_and_size": {"lino": "One size designed to fit 5''0\" to 6''5\". Sleeker, more minimal design. Smaller footprint works better in compact spaces. Modern, less ''office-y'' appearance.", "aeron": "Three sizes (A, B, C) to fit different body types perfectly. Industrial-technical design. Larger footprint, more substantial presence. Iconic recognizable form.", "recommendation_trigger": "Lino is excellent for apartments, small home offices, or modern aesthetic preferences. Aeron is better for very small or very large users who need size-specific support."}, "target_user_profile": {"lino": ["First-time premium chair buyers", "Users wanting Herman Miller quality at accessible pricing", "Smaller spaces or multi-purpose rooms", "Younger professionals setting up first home office", "Those who prefer simpler, more intuitive designs"], "aeron": ["Power users who sit 8+ hours daily", "Users with existing back or neck issues", "Those who want maximum longevity and resale value", "Individuals who appreciate granular control", "Anyone who has tried Aeron and knows it works for them"]}, "warranty_and_support": {"lino": "12-year comprehensive warranty. Newer product so long-term data limited, but engineered to same Herman Miller standards. Less established resale market.", "aeron": "12-year comprehensive warranty. Massive parts availability. Known for lasting 15-20+ years. Strong resale market ($400-800 used).", "recommendation_trigger": "If planning to keep long-term (10+ years), both are excellent. If might resell in 5-7 years, Aeron has proven resale value."}, "material_and_construction": {"lino": "Duo Suspension back - breathable, flexible mesh with integral lumbar. Studio Seat - cushioned but still breathable. More traditional materials but still highly durable. 12-year warranty.", "aeron": "8Z Pellicle suspension - iconic mesh that doesn''t compress, sag, or trap heat. Every zone is engineered for specific body regions. Ocean-bound plastic in newer models. Built to last 12-20 years with heavy use.", "recommendation_trigger": "Aeron''s full-suspension design is better for hot climates or users who run warm. Lino''s cushioned seat is preferred by users who like some padding."}}', '{"Budget - is $800 vs $1,700 a significant factor?","Space constraints - compact office or generous space?","Adjustment complexity preference - simple or comprehensive?","Experience with premium chairs - first timer or ergonomics enthusiast?","Health concerns - specific medical needs or general comfort?","Timeline - Aeron''s proven 30-year 