	('df4a7a8d-74d9-4ce5-95d7-8bc35e692f15', '{eae98cf2-100b-45c1-9fa8-73b057b7d288,543f17bc-f34f-47b2-af45-1d6f930da323}', 'Cosm vs Lino - The $1,200 vs $800 decision: Automatic luxury vs manual simplicity', '{"price_analysis": {"cosm": "$1,195+ (Mid Back with arms). You''re paying for: automatic adjustment technology, full-suspension comfort, striking design, hot-desking capability. Premium justified by the effortless experience and multi-user functionality.", "lino": "$799+ (standard config). You''re paying for: Herman Miller ergonomics, modern engineering, 12-year warranty, essential adjustments. Exceptional value - this is where HM quality becomes accessible to more buyers.", "recommendation_trigger": "The $400 difference breaks down to: Cosm = luxury and convenience. Lino = value and control. Both are excellent chairs. This is about what experience you want, not quality difference."}, "decision_scenarios": {"choose_cosm_when": ["Multiple users will share the chair (hot-desking, conference rooms)", "Buyer values effortless/automatic experience over manual control", "Design and aesthetics are high priority", "Budget allows and they want the ''latest technology''", "They''ve been overwhelmed by complex ergonomic chairs before", "Office has a modern/contemporary design aesthetic"], "choose_lino_when": ["Single dedicated user (home office, assigned desk)", "Budget is a factor and $800 vs $1,200 matters", "Buyer prefers having control over adjustments", "Smaller space or needs compact footprint", "First-time premium chair buyer testing the waters", "Prefer understated professional look over statement piece"]}, "material_and_comfort": {"cosm": "Full-body Intercept Suspension - one continuous piece from seat to back creates a floating sensation. Very breathable, excellent for warm climates. The suspension feels more ''premium'' and responsive. Available in eye-catching colors (Canyon, Glacier, Nightfall).", "lino": "Duo Suspension back with Studio Seat (padded). Hybrid approach - breathable back, cushioned seat. Some users prefer this if they like padding under them. More understated color palette (Black, Mineral frames with neutral suspension colors).", "recommendation_trigger": "Cosm feels more luxurious and futuristic. Lino feels more grounded and traditional-ergonomic. Try to understand if they run hot ( Cosm full suspension) or prefer some cushioning ( Lino padded seat)."}, "use_case_sweet_spots": {"cosm": "Shared workspaces are where Cosm truly shines - every person who sits down gets automatic support. Also excellent for users who''ve had bad experiences with complex ergonomic chairs. The sculptural design makes it a focal point in modern offices.", "lino": "Personal home offices and assigned desks - you set it once for your body. Also excellent for smaller spaces (more compact footprint) and modern apartments where the minimal aesthetic fits better. Great first premium chair.", "recommendation_trigger": "Will multiple people use this chair? If yes, Cosm justifies its premium. If it''s just you, Lino delivers the same ergonomic benefits with simple manual controls."}, "adjustment_experience": {"cosm": "Zero manual adjustments needed. Auto Harmonic Tilt automatically balances your recline. The Intercept Suspension dynamically adjusts to your movements. Leaf Arms pivot naturally with you. It''s like the chair reads your mind.", "lino": "6-8 straightforward adjustments. Seat height, arm height, recline tension - the essentials you actually use. Takes 2-3 minutes to dial in your preferences, then you''re done. No overwhelming control panel.", "recommendation_trigger": "Cosm is perfect for: hot-desking, multiple users, those intimidated by adjustments. Lino is perfect for: single users who want control, those who enjoy optimizing their setup."}, "aesthetic_and_presence": {"cosm": "Sculptural statement piece - looks like art, guests will ask about it. The seamless form is conversation-starting. High-back version (51.6\") is particularly striking. Best for: modern offices, creative spaces, design-conscious buyers.", "lino": "Sleek professional look - clearly high-quality but doesn''t dominate the room. Smaller footprint, more versatile. Better for: multi-purpose rooms, traditional offices, spaces where the chair shouldn''t be the hero.", "recommendation_trigger": "Is this room about making a design statement ( Cosm) or professional functionality ( Lino)?"}, "core_value_proposition": {"cosm": "Premium effortless experience - you literally just sit down and the chair does everything. Auto-adjusting technology that responds to your body in real-time. This is the ''set it and forget it'' luxury option.", "lino": "Accessible Herman Miller quality - you make a few simple adjustments and you''re set. Intuitive controls without complexity. This is the ''smart value'' option that doesn''t sacrifice ergonomics.", "recommendation_trigger": "Ask: ''Would you rather never think about adjustments, or have simple control over your setup?'' The $400 difference is essentially paying for automation vs doing it yourself."}}', '{"Single user vs shared/multiple users (critical differentiator)","Budget sensitivity to $400 difference","Preference for automatic vs manual control","Aesthetic priority (statement piece vs professional understated)","Space constraints (Lino has smaller footprint)","Material preference (full suspension vs hybrid cushion/suspension)","Design style of surrounding environment"}', '[-0.013236728,0.015941313,0.0044575576,-0.010396197,0.04768084,-0.044618506,-0.0057919626,0.027775664,0.039037615,0.012471144,-0.015626494,0.0062570367,-0.018860549,-0.014045241,0.0474805,0.032626744,-0.03465876,-0.043187506,-0.022080293,0.02402645,0.0060996274,0.04330199,0.0074125673,0.019089507,0.013494307,-0.010560762,-0.04768084,-0.032397784,-0.0049941815,-0.02293889,0.043473706,-0.027861523,0.010703862,-0.032340545,-0.029092181,0.022767171,-0.014925305,0.03408636,-0.0026562891,-0.009580528,-0.0022019476,0.039