INSERT INTO "public"."use_case_scenarios" ("id", "scenario_name", "user_profile", "pain_points", "recommended_products", "talking_points", "objection_handlers", "success_metrics", "budget_range", "recommended_configurations", "embedding", "created_at", "updated_at") VALUES
	('463fc03e-6e18-49be-860e-24b203092198', 'Remote Worker with Back Pain - Home Office Setup', '{"occupation": "Software Engineer", "experience_level": "First-time premium chair buyer", "work_environment": "Home office, 8-10 hours daily", "decision_timeline": "1-2 weeks", "purchase_authority": "Individual"}', '{"Lower back pain after long sitting sessions","Current chair lacks lumbar support","Difficulty maintaining good posture throughout the day","Concerned about long-term health impacts","Unsure if expensive chair is worth the investment"}', '{a84ed3b1-af81-4bbe-9f76-04e3aa95a078,543f17bc-f34f-47b2-af45-1d6f930da323}', 'For someone experiencing back pain during long work sessions, the key is finding a chair that provides both dynamic support and encourages movement. The Aeron Chair is the gold standard here - its PostureFit SL provides targeted lumbar support that adjusts to your spine''s natural curve, not just your lower back. The 8Z Pellicle suspension distributes your weight evenly, eliminating pressure points that cause discomfort. What makes it special for developers is that it supports you whether you''re leaning forward coding or reclining during a call. The Lino Chair is our newer, more budget-friendly option that still delivers excellent lumbar support through its Duo Suspension back. It''s particularly good if you prefer a more minimal aesthetic. Both chairs encourage micro-movements throughout the day, which research shows is crucial for spinal health. Given your pain points, I''d lean toward the Aeron Size B with PostureFit SL and adjustable arms - it''s an investment, but one that typically pays for itself in improved comfort and productivity within months.', '{"price_concern": "I completely understand the price feels significant. Let me break down the value: if you''re working 8 hours a day, that''s 2,000+ hours per year in this chair. The Aeron typically lasts 12+ years with the warranty, so you''re looking at about $0.50 per hour of use. Compare that to physical therapy visits or ergonomic accessories you might buy trying to fix a cheaper chair. Most of our customers with back pain tell us they wish they''d made this investment sooner.", "need_to_try_first": "That''s a smart approach. The Aeron has a 30-day trial period through most authorized dealers. What I''d suggest is trying Size B if you''re 5''4\"-6''6\" and under 230 lbs - that''s the sweet spot for most people. Pay attention to the lumbar support in the first few days as your body adjusts to proper posture support.", "comparing_to_gaming_chairs": "Gaming chairs and office chairs serve different purposes. Gaming chairs prioritize aesthetics and racing-style seating, but they''re typically padded foam that compresses over time. The Aeron uses a suspension membrane that doesn''t compress and provides better airflow. For someone with existing back pain, the Aeron''s PostureFit SL targets the specific vertebrae that need support, while gaming chairs offer more general cushioning that doesn''t address postural issues."}', '{"Reduced or eliminated back pain within 2-4 weeks","Improved ability to maintain focus during long sessions","Better posture awareness throughout the day","Customer reports they can work longer without discomfort"}', '{"max": 2000, "min": 1000, "notes": "Willing to invest for health, but wants to understand value", "flexibility": "medium"}', '{}', '[0.009433752,-0.009130924,0.05042745,0.03391674,0.011586464,-0.0015050883,0.015826056,0.03307409,0.022053782,0.0050394535,-0.01998665,-0.002972323,-0.014943905,-0.003729393,-0.033442747,0.0324421,0.04995346,-0.0934817,-0.06972945,0.0093679195,0.02319926,0.03254743,0.019328328,0.024410574,0.009697081,-0.00040527937,-0.018340847,-0.055878356,-0.015536395,-0.019683823,-0.009631248,-0.018051185,-0.0050460366,-0.006971628,-0.050954107,-0.008703015,-0.025319057,0.037076686,0.058880303,-0.029308487,0.04684618,0.07741865,0.032758094,0.00762995,-0.006965045,-0.0068267975,0.00048098637,0.04700418,0.02