,0.01859101,0.02180362,0.007939361,0.02556922,0.032310434,-0.012692445,-0.0051908675,-0.010111823,-0.021922117,0.018354012,0.04866315,0.05856431,0.015602227,0.027175525,-0.017300697,0.0031862776,-0.029492818,-0.010954475,-0.020144647,-0.027623184,-0.04976913,-0.008999259,-0.004190218,-0.0003250464,-0.018828005,-0.024489572,-0.016708208,0.0038281414,-0.0003692774,-0.014575245,-0.0004933299,-0.012593697,-0.010210572,0.00018957611,-0.018880669,0.011336301,-0.0053751976,0.04171127,0.03739268,0.023581088,-0.03583904,-0.025858881,-0.021632455,-0.020118315,-0.025095228,-0.003647103,0.009664164,0.0011471257,-0.005414697]', '2025-09-30 16:05:38.542164+00', '2025-09-30 16:05:38.542164+00'),
	('937a0f29-0a32-45cf-898e-47fffc9331e7', 'Corporate Bulk Purchase - Office Fit-Out', '{"occupation": "Office Manager / Facilities Director", "experience_level": "Experienced with office furniture procurement", "work_environment": "Corporate office, 50-100 employees", "decision_timeline": "1-3 months with multiple stakeholders", "purchase_authority": "Requires executive approval"}', '{"Need to balance budget constraints with employee satisfaction","Diverse employee body types and preferences","Wants furniture that makes a statement about company culture","Concerned about long-term durability and warranty support","Need to coordinate with interior design aesthetic","Previous cheap chairs led to employee complaints and frequent replacements"}', '{eae98cf2-100b-45c1-9fa8-73b057b7d288,543f17bc-f34f-47b2-af45-1d6f930da323}', 'For a corporate fit-out, you''re really making two investments: one in employee wellbeing and one in your company''s physical brand. The Cosm Chair is our best solution for diverse workforces because it automatically adjusts to each user without any manual controls - employees just sit down and it conforms to their body. This is crucial when you have hot-desking or shared workspaces. No training needed, no adjustment period. The Intercept Suspension provides that premium Herman Miller feel while being remarkably easy to maintain. For a 50-100 person office, you''d likely want a mix: Cosm for open workspace and hot-desking areas where simplicity is key, and perhaps Aeron or Lino for assigned desks where employees can dial in their perfect setup. The Cosm comes in multiple colorways - the Studio White or Semi-Polished Alloy frames make a striking design statement that signals you invest in your people. From a facilities standpoint, Herman Miller''s 12-year warranty is industry-leading, and we have a strong service network. These chairs typically last 15-20 years in corporate settings. I''d also mention that companies often see reduced sick days and improved retention after upgrading to proper ergonomic seating - there''s real ROI beyond the initial cost.', '{"budget_constraints": "I understand you''re working within a specific budget. Let''s talk about a phased approach: start with 20-30 chairs for your most critical roles or those with existing discomfort issues. You can expand as budget allows. We also offer volume discounting starting at 10+ units, and many companies find that spreading the cost over 2-3 fiscal years makes it more manageable. The Lino Chair is an excellent option at a lower price point while still maintaining Herman Miller quality - it''s about 40% less than the Cosm but still delivers excellent ergonomic support.", "long_procurement_timeline": "A 1-3 month timeline actually works well for us. Here''s how we typically structure it: Week 1-2, we set up demo chairs in your office so employees can try them. Week 3-4, gather feedback and finalize specifications and colors. Week 5-8, we process the order and coordinate delivery timing with your facilities team. Week 9-12, delivery and installation with minimal disruption. This gives you time to build internal consensus and manage stakeholder approvals.", "employees_want_different_chairs": "That''s actually very common and shows your employees are engaged. The beauty of the Cosm is its versatility - the auto-adjusting mechanism means it works for 95% of users without them needing to think about it. For the 5% with very specific needs - perhaps someone with a medical condition - you can accommodate them with an Aeron that offers more granular adjustments. We can help you establish a chair allocation policy that gives some choice while maintaining consistency."}', '{"Reduced employee complaints about seating within 30 days","Positive feedback in next employee satisfaction survey","Fewer facilities maintenance requests related to chairs","Achievement of aesthetic goals for office space","Successful coordination with planned rollout timeline"}', '{"max