,0.011681548,-0.0061962106,0.014695922,-0.0064286115,-0.027710356,-0.009473743,-0.007928962,-0.026329624,-0.026985813,-0.027395932,-0.005198255,0.0016088616,0.005010284,-0.026356963,-0.005181167,-0.0057553328,0.026288612,0.02735492,-0.013110129,-0.021955023,-0.024620796,-0.016213361,-0.005782674,-0.007375302,0.006739618,0.0048428187,0.0075598555,0.034149222,0.023472462,-0.017799154,-0.0524952,-0.013834672,-0.019125205,-0.005140155,0.0029050077,-0.016746515,-0.018250285,-0.006244058]', '2025-09-30 16:05:39.460565+00', '2025-09-30 16:05:39.460565+00'),
	('f301221f-b342-4efb-aff7-15bfa7072f1f', 'Creative Professional - Studio Aesthetic and Function', '{"occupation": "Graphic Designer, Photographer, Architect, Creative Director", "experience_level": "Design-literate, understands good design, moderate furniture knowledge", "work_environment": "Home studio or small agency (3-10 people), client visits occasionally", "decision_timeline": "2-4 weeks, researches thoroughly", "purchase_authority": "Individual or small team decision"}', '{"Current chair doesn''t match the aesthetic quality of their work","Studio/office is part of their portfolio when clients visit","Long hours in front of screen doing detailed work","Appreciates design but not executive-level budget","Wants something Instagram-worthy but genuinely functional","Previous ''designer'' chairs looked good but weren''t comfortable for full workdays"}', '{eae98cf2-100b-45c1-9fa8-73b057b7d288,543f17bc-f34f-47b2-af45-1d6f930da323}', 'As a creative professional, your workspace IS part of your work - it tells clients about your attention to detail and standards. The Cosm Chair is designed for exactly this situation. It''s sculptural enough to be a focal point in your studio, available in colors that actually make a statement - Canyon, Glacier, Nightfall - not just ''office black.'' The Intercept Suspension looks like one continuous piece of material, which is incredibly photogenic and modern. What makes it perfect for creatives is the effortless experience - you sit down and it just works. No fiddling with levers when a client is there, no awkward adjustments. The Auto Harmonic Tilt means you can lean back during a phone call or lean forward to review details on screen, and the chair moves with you naturally. For long retouching sessions or CAD work, that continuous support prevents the fatigue that kills your eye for detail late in the day. The Lino Chair is the understated alternative if you prefer a more minimal look - it''s equally modern but doesn''t try to be the hero piece. Some studios do Cosm for the main desk area where clients see, and Lino for team members or back-office work. Both have that Herman Miller quality that signals you''re serious about craft. The key difference: Cosm is a conversation piece and design statement, Lino is quietly confident and professional.', '{"want_it_to_photograph_well": "That''s exactly what the Cosm was designed for. Studio Yves Bhar created it to be photogenic from every angle - there are no bad sides. The high-back version in particular has that striking silhouette. The Canyon or Glacier colorways photograph beautifully in natural light. You can literally shoot your chair for your studio''s Instagram and it''ll look intentional, not like you''re trying too hard. The Eames chairs do this too, but they read more ''midcentury'' - Cosm is distinctly contemporary.", "small_studio_space_concerns": "Perfect point - the Lino has a notably smaller footprint than most ergonomic chairs. It''s designed for exactly this situation: apartments, small studios, multi-purpose rooms. The Cosm is slightly larger but still reasonable. Both are way more space-efficient than gaming chairs or traditional executive chairs. And because they look good from all angles, you can place them where they''re visible rather than hiding them.", "too_expensive_for_creative_budget": "I get it - creative budgets are tight, and this feels like a lot for a chair. Here''s how I''d think about it: this is a tool, like your camera or software subscription. If you bill $75-150/hour, this chair pays for itself in less than 10 billable hours of improved comfort and focus. The Lino at $799 is particularly compelling - it''s Herman Miller quality at a price point that won''t make your accountant cry. And unlike a computer that''s obsolete in 3 years, this chair will still be contemporary and comfortable in 10 years. Also, it''s a legitimate business expense and tax write-off.", "prefer_more_unique_boutique_brands": "I respect that impulse - you want something not everyone has. Here''s the thing: Cosm is Herman Miller''s newest chair (2019), so it''s not as ubiquitous as the Aeron yet. When clients see it, they recognize it''s quality but it doesn''t scream ''I bought the same chair as every tech startup.'' The color options help with this - Canyon and Glacier are distinctly not corporate. If you really want something special, the Eames Aluminum chairs are design icons that never go out of style, though they''re pricier. But honestly? Having a Cosm or Lino shows you prioritize function over fashion, which is its own form of sophistication."}', '{"Studio aesthetic elevated to match quality of creative output","Positive client comments about the space","Ability to work through long detail-oriented sessions comfortably","Chair photographs well for portfolio/social media","Improved posture during precision work (retouching, CAD, illustration)"}', '{"max": 1500, "min": 800, "notes": "Will stretch budget for right design, views as business investment and tax write-off, values design legacy", "flexibility": "medium-high"}', '{}', '[0.015677309,0.012384061,-0.008533494,0.00035691934,0.02653417,-0.07394247,-0.00072288606,0.031991553,0.018181626,-0.024304895,-0.02349425,0.0027757378,-0.009677083,-0.03830301,0.012463678,0.07330553,-0.0045273113,-0.08726022,-0.016140535,0.029385906,0.007787989,0.047654387,-0.027865946,0.042153575,0.020859651,0.00038768045,-0.049015112,-0.032223165,0.006011083,0.0070497226,0.010321257,-0.026288081,0.0013263467,-0.03089139,-0.001183398,0.011045048,-0.019006746,0.015836542,-0.0026906922,-0.010733818,-0.017414406,0.06693617,0.050868016,-0.008671014,0.006210125,-0.06629924,0.008801296,0.03656591,0.03477091,0.030543972,-0.028184414,0.007939985,0.034191877,-0.007809703,-0.04556987,-0.007411618,-0.0797907,-0.021815054,-0.004089418,0.026794735,0.04629366,-0.009597466,0.013469746,0.010277829,-0.08482828,-0.0010386398,-0.023190258,0.010386398,-0.033583894,-0.02698292,0.05749794,0.00