4,-0.018065818,-0.022365136,-0.028430503,-0.021699248,-0.014352771,-0.04432495,-0.00068488705,-0.021713724,0.0034452442,-0.0052438644,0.003998944,0.023132354,0.017370978,-0.014555433,-0.029429333,0.01834086,-0.008851961,-0.026114373,0.012159686,0.013628981,-0.012434726,0.02030957,0.021018885,-0.011609605,-0.014852188,-0.017370978,0.00287164,0.00013661552,0.01657481,-0.0122393025,-0.020946506,0.011095713]', '2025-09-30 16:05:39.754702+00', '2025-09-30 16:05:39.754702+00'),
	('01b22a58-efbb-45f7-b418-4cfaf658eb80', 'Student/Recent Grad - First Quality Setup', '{"occupation": "Graduate student, entry-level professional, or bootcamp grad", "experience_level": "Never owned premium furniture, used campus/office chairs", "work_environment": "Apartment, shared housing, or first studio", "decision_timeline": "Flexible, saving up or watching for sales", "purchase_authority": "Individual, very price-conscious"}', '{"Current IKEA/Amazon chair causing discomfort after long study/work sessions","Small budget but recognizes need for quality","Unsure if Herman Miller is ''for people like them''","Wants something that will last through career progression","Limited space in apartment or shared housing","Sees expensive chairs as ''luxury'' not ''investment''","May need to justify expense to parents or partner"}', '{543f17bc-f34f-47b2-af45-1d6f930da323}', 'Let me start by saying: Herman Miller isn''t just for executives or big companies. The Lino Chair was specifically designed to make Herman Miller ergonomics accessible to people who are starting out. At $799, it''s a real investment on a student or entry-level budget, but here''s why it makes sense: you''re entering the phase of your career where you''ll be sitting 8+ hours a day for the next 40+ years. The chair you choose now sets your baseline for back health. The Lino gives you genuine Herman Miller engineering - the Duo Suspension back with lumbar support, adjustable arms, quality construction - at about half what an Aeron costs. It''s covered by the same 12-year warranty, which means this chair can literally take you from entry-level to senior roles. The compact footprint works in small apartments, and the modern minimal aesthetic doesn''t scream ''office'' if you''re working from your bedroom or living room. What makes this different from a $200-300 ''ergonomic'' chair is that those chairs feel okay for the first few months, then the foam compresses, the mechanisms get loose, and you''re back shopping in 2-3 years. You''ll spend more replacing cheap chairs than buying one good one. This is your first real career investment - think of it like buying quality shoes or a good mattress. Your body will thank you.', '{"cant_justify_800_dollars": "I completely understand - $800 feels like a huge number when you''re starting out. Let''s reframe this: if you keep this chair for just 5 years (though it''ll last 10+), that''s $160 per year, or about $13 per month. That''s less than most streaming subscriptions. If you work or study 40 hours a week, that''s $0.07 per hour. You probably spend more on coffee per day than this chair costs per week. And unlike coffee, this chair is a one-time purchase that protects your health. Many of our younger customers finance it on a 0% APR credit card or save up over 2-3 months. It''s also a legitimate home office tax deduction if you''re freelancing or self-employed.", "partner_thinks_its_wasteful": "This is a really common conversation. Here''s how to frame it: ask your partner what they spend on their most-used item - maybe a car, phone, or bed. They probably didn''t buy the cheapest option because they use it constantly. You''re going to spend 2,000+ hours per year in this chair - it''s literally the interface between your body and your income. A $200 chair that hurts your back and needs replacing in 2 years isn''t frugal, it''s expensive. The Lino at $799 with a 12-year warranty is actually the financially responsible choice. Show them the per-hour cost calculation. If they still push back, suggest a trial period from a dealer that offers returns - once they see the difference in your comfort and productivity, they''ll get it.", "should_i_just_buy_used_aeron": "That''s a smart instinct - the used market for Aerons is strong. A used Aeron in good condition runs $400-700, so the savings aren''t as dramatic as you might think. The risk is: you don''t know how it was maintained, whether all the adjustments work, if it''s the right size for you, and there''s no warranty. The Lino at $799 new gives you: right size for your body, full warranty, modern design, and the peace of mind that it''s YOUR chair. If budget is really tight, a used Aeron from a reputable dealer isn''t a bad move, but I''d argue the extra $100-200 for new Lino is worth it for the warranty alone.", "too_nice_for_my_current_situation": "I hear this a lot, and it''s actually backwards thinking. You don''t ''earn'' the right to good ergonomics by reaching a certain career level. Your spine doesn''t care if you''re an intern or a VP. The time to invest in your back health is NOW, at the beginning of your career, not after you''ve spent years in cheap chairs developing chronic pain. The Lino isn''t flashy or status-y - it''s a smart, practical choice. Think of it as investing in future-you. And honestly? Having a quality chair in your first apartment or home office signals to yourself that you''re serious about your work, even if no one else sees it."}', '{"Successfully completes long study/work sessions without discomfort","Feels confident about the investment after first few weeks","Chair fits well in limited apartment space","Begins to see chair as career investment rather than expense","Improves posture and reduces fatigue during thesis writing, coding, etc."}', '{"max": 900, "min": 500, "notes": "Very price-sensitive, may be saving up, looking for sales, considering financing, needs strong value justification", "flexibility": "low"}', '{}', '[-0.020032393,-0.0013807849,0.013296196,-0.004059338,0.03613421,-0.048007265,0.029113384,0.05768462,0.0109514035,-0.011398676,0.011263139,0.0069191726,-0.028815202,-0.011351238,0.010294048,0.02636198,-0.0134317335,-0.1039299,-0.05784726,0.059636354,0.039332885,0.06776858,-0.02618578,0.012611734,0.05294082,-0.0109514035,-0.018907435,-0.037164293,-0.0016349171,-0.037110075,0.024627103,-0.016860824,-0.018609254,-0.009718015,-0.017416526,0.015247932,-0.013635039,0.023840988,0.023719003,-0.00